import React,{useState} from "react"
import './App.css';
import { useHistory } from "react-router-dom"

function AddAnimal({AddAnimal}){
  const navigate = useHistory()

  const [name, setName] = useState("")
  const [breed, setBreed] = useState("")
  const [age, setAge] = useState("")
  const [gender, setGender] = useState("")
  const [size, setSize] = useState("")
  const [weight, setWeight] = useState("")
  const [personality, setPersonality] = useState("")
  const [healthStatus, setHealthStatus] = useState("")
  const [AvailabilityStatus, setAvailabilityStatus] = useState("")
  const [image, setImage] = use

function handleSubmit(e){
  e.preventDefault()

   const newAnimal = {
    name:name,
    breed:breed,
    age:age,
    gender:gender,
    size:size,
    weight:weight,
    personality:personality,
    healthStatus:healthStatus,
    AvailabilityStatus:AvailabilityStatus,
    image:image,
  }

  fetch("http://localhost:3000/animals",{
    method:"POST",
    headers: {
      "Content-Type":"application/json",
    },
    body: JSON.stringify(newAnimal)
  })
  .then((response)=>response.json())
  .then((data) => AddAnimal(data))

  setInputClear()
  Navigate('/');
  }

  function setInputClear(){
    setName()
    setBreed()
    setAge("")
    setGender("")
    setSize("")
    setWeight("")
    setPersonality("")
    setHealthStatus("")
    setAvailabilityStatus("")
    setImage("")
  }
  return(

  // display the form with input fields and a submit button
    <div className="add-animal" onSubmit={handleSubmit}>
<form className="animal-form">
  <h5>ADD-ANIMAL-HERE</h5>
  <br/>
  <label type="text">name:</label>
  <input type="text" id="name" value={name} onChange={(e)=>setName(e.target.value)}/>
  <label type="text">breed:</label>
  <input type="text" id="breed" value={breed} onChange={(e)=>setBreed(e.target.value)}/>
  <br/>
  <label type="text">age:</label>
  <input type="number" id="age" value={age} onChange={(e)=>setAge(e.target.value)}/>
  <label type="text">gender:</label>
  <input type="text" id="gender" value={gender} onChange={(e)=>setGender(e.target.value)}/>
  <br/>
  <label type="text">size:</label>
  <input type="number" id="size" value={size} onChange={(e)=>setSize(e.target.value)}/>
  <label type="text">weight:</label>
  <input type="text" id="weight" value={weight} onChange={(e)=>setWeight(e.target.value)}/>
  <br/>
  <label type="text">personality:</label>
  <input type="text" id="personality" value={personality} onChange={(e)=>setPersonality(e.target.value)}/>
  <label type="text">healthStatus:</label>
  <input type="text" id="healthStatus" value={healthStatus} onChange={(e)=>setHealthStatus(e.target.value)}/>
  <br/>
  <label type="text">AvailabilityStatus:</label>
  <input type="text" id="AvailabilityStatus" value={AvailabilityStatus} onChange={(e)=>setAvailabilityStatus(e.target.value)}/>
  <label type="text">image-url:</label>
  <input type="img" id="image" value={image} onChange={(e)=>setImage(e.target.value)}/>
  <button class="submit" type="submit">Submit</button>
</form>
    </div>
  )
}
export default AddAnimal
